package com.bridgelabz.binarytree;

public class MyBinaryNode {
	int data;
	public MyBinaryNode left;
	public MyBinaryNode right;
	public int key;
	
	
	public MyBinaryNode() {
		super();
		// TODO Auto-generated constructor stub
	}


	public MyBinaryNode(int data, MyBinaryNode left, MyBinaryNode right, int key) {
		super();
		this.data = data;
		this.left = left;
		this.right = right;
		this.key = key;
	}


	
	

}
